import React from 'react'

const MainBox = () => {
  return (
    <div className='w-full flex flex-col text-black p-4'>

        <div className='flex items-baseline justify-between'>
            <h2 className=' font-semibold text-2xl'>Hi,Jennie Moss</h2>

            <p className=' text-sm'>Last scanned March 20th,2023 11:30 PM IST</p>
        </div>

    </div>
  )
}

export default MainBox
